	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	this.actionFrames = [0,1];
	// timeline functions:
	this.frame_0 = function() {
		this.stop();
		
		document.addEventListener("keydown", handleKeyDown);
		document.addEventListener("keyup", handleKeyUp);
		
		var root = this;
		var speed = 15;
		
		function handleKeyDown(event) {
			console.log(root.city_mc.x);
			if (root.man_mc.currentFrame == 37){
				  root.man_mc.gotoAndPlay("walking");
			}
		
			if (event.keyCode == 39 && root.city_mc.x > -3182.5) {
				root.man_mc.scaleX = 1;
				root.city_mc.x = root.city_mc.x - speed;
			}
			
			if (event.keyCode == 37 && root.city_mc.x < 4377.5) {
				root.man_mc.scaleX= -1;
				root.city_mc.x = root.city_mc.x + speed;
			}
		}
		
		function handleKeyUp(event){
			root.man_mc.gotoAndPlay("standing");
		}
		
		this.city_mc.ratCan_mc.addEventListener("click",handleClickRatcan);
		
		function handleClickRatcan(event){
			root.city_mc.ratCan_mc.play();
		}
		
		this.city_mc.sign_mc.addEventListener("click",handleClickSign);
		
		function handleClickSign(event){
			root.city_mc.sign_mc.play();
		}
		
		this.city_mc.bird_mc.addEventListener("click",handleClickBird);
		
		function handleClickBird(event){
			root.city_mc.bird_mc.play();
		}
		
		this.city_mc.ratCan_mc.addEventListener("click",handleClickRatCan);
		
		function handleClickRatCan(event){
			var music_snd = createjs.Sound.play("can");
			root.city_mc.ratCan_mc.play();
		}
		
		this.city_mc.sign_mc.addEventListener("click",handleClickSignSound);
		
		function handleClickSignSound(event){
			var music_snd = createjs.Sound.play("swing");
			root.city_mc.sign_mc.play();
		}
		
		this.city_mc.bird_mc.addEventListener("click",handleClickBirdSound);
		
		function handleClickBirdSound(event){
			var music_snd = createjs.Sound.play("flap");
			root.city_mc.bird_mc.play();
		}
		
		this.play_btn.addEventListener("click",handleClickPlayButton);
		
		function handleClickPlayButton(event){
			var music_snd = createjs.Sound.play("sound");
			root.play();
		}
	}
	this.frame_1 = function() {
		this.stop();
	}

